/* Child and page sizes. */
typedef int child_s;
typedef int page_s;

/* Int as pointers. */
typedef int char_p;
typedef int child_p;
typedef int page_p;

/* A node of the Radix tree. */
struct Node {
    char_p chars;
    child_p children;
    page_p pages;
    child_s child_count; // The number of children
    page_s page_count;   // The number of pages.
};

/* Struct storing the data associated with a page. */
public Page {
    short page_index;
    short count;
};

